import React from 'react';
import './App.scss';
import Navigation from './containers/Navigation/Navigation.js'
import Menu from './containers/Menu/Menu.js'
import Main from './containers/Main/Main.js'


class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Router>
        <Navigation />
        <div className='row'>
          <div className='col-2'>
            <Menu />
          </div>
          <div className='col-10'>
            <Main />
          </div>
        </div>
        </Router>
      </div>
    );
  }

}

export default App;
